import React, { useState } from 'react'
import { useStyle } from './HeaderStyle'
import Hidden from '@material-ui/core/Hidden';
import Drawer from '@material-ui/core/Drawer';
import { Paper, Typography } from '@mui/material';



export default function Sidenav() {

    const classes = useStyle();
    const [mobileOpen, setMobileOpen] = useState(false);
    const handaleDrawerOpen =()=>{
        setMobileOpen(!mobileOpen);
    }
  return (
    <nav className={classes.drawer} aria-label="mailbox folders">
        {/* The implementation can be swapped with js to avoid SEO duplication of links. */}
        <Hidden smUp implementation="css">
          <Drawer
            container={Paper}
            variant="temporary"
            anchor={'left'}
            open={mobileOpen}
            onClose={handaleDrawerOpen}
            classes={{
              paper: classes.drawerPaper,
            }}
            ModalProps={{
              keepMounted: true, // Better open performance on mobile.
            }}
          >
            <Typography variant="h6"> Lorem ipsum dolor sit, amet consectetur adipisicing elit. Error dolorum iure autem! </Typography>
          </Drawer>
        </Hidden>
        <Hidden xsDown implementation="css">
          <Drawer
            classes={{
              paper: classes.drawerPaper,
            }}
            variant="permanent"
            open
          >
          <Typography variant="h6"> Lorem ipsum Permanent dolor sit, amet consectetur adipisicing elit. Error dolorum iure autem! </Typography>

          </Drawer>
        </Hidden>
      </nav>
  )
}
